lyrics:
Alone at last, you and I
Together locked in a sigh
The musics soft, lights are low;
The mood is one all lovers know
Oh, my darling at last we are one;
The trip to heavens begun;
I kiss your fingertips, your eyes, your lips
Oh what exciting moments we share when were
All alone at last
Oh, my darling, at last, you and I
Together locked in a sigh
The musics soft, lights are low;
The mood is one all lovers know
Oh, my darling at last we are one;
The trip to heavens begun;
I kiss your fingertips, your eyes, your lips
Oh what exciting moments we share when were
All alone at last

Well I went to a turkey roast down the street
The people down there eat like wild geese;
I'm on my way, I'm goin' back to Alabam'
Talk about yer people have a whale of a time
Eatin' up chicken' and drinkin' their wine;
I'm on my way, I'm goin' back to Alabam'
Now some folks say a tramp won't steal
But I caught three in my corn field;
I'm on my way, I'm goin' back to Alabam'
One had a bushel and the other had a peck
One had a roast'n' ear tied round his neck;
I'm on my way, I'm goin back to Alabam'
There comes Sal walkin' down the street
With run down shoes tied to her feet;
Good Mornin', honey, stand over there, baby
Get over there, now
Hello Sal, I know you
With a run down slipper and a tore up shoe;

Please wait for me; for I shall return;
My love for you will forever burn
Though we must part;
There's no reason to cry
Just say so long;
Because lovers never say goodbye
I love you;
My darling more than life itself
I wouldn't try to hurt you;
For I'd only be hurting my self
Just kiss me dear;
And hold me tight;
For you know this is not our last night
Though we must part;
There's no reason to cry
Just say so long;
Because lovers never say goodbye
